  //   "present":true,
  //   "age":8,
  //   "chipNumber":"IOQ831684",
  //   "owner":{
  //   "name":"Ina",
  //   "lastName":"Robinson",
  //   "phoneNumber":"0705823141"
  //          }
  //       },


  return (
    <BaseComponent
      headerContent={
        <div>
          <h1 id="pageTitle">Hundregister</h1>
        </div>
      }
      mainContent={
        <div>
          {!dogs ? (<div><p>Loading dogs...</p></div>) : (<div>{dogs.map(dog => <DogItem />)}</div>)

          }
          <DogItem />
        </div>
      }
    />
  );
};

export default Register;
